import "./App.css";

function App() {
  const Job = (props) => {
    return (
      <div>
        <h1>{props.salary}</h1>
        <h1>{props.position}</h1>
        <h1>{props.company}</h1>
      </div>
    );
  };
  return (
    <div className="App">
      <Job salary={1111} position="MOdir" company="IT" />
    </div>
  );
}

export default App;
